(11, 'chen', '苹果', '<p>苹果是蔷薇科苹果亚科苹果属植物，其树为落叶乔木。苹果营养价值很高，富含矿物质和维生素，含钙量丰富，有助于代谢掉体内多余盐分，苹果酸可代谢热量，防止下半身肥胖。<br>苹果是一种低热量的食物，每100克产生大约60千卡左右的热量。苹果中营养成分可溶性大，容易被人体吸收，故有“活水”之称。它有利于溶解硫元素，使皮肤润滑柔嫩。</p><p><h2>主要品类</h2>苹果品种数以百计，分为酒用品种、烹调品种、鲜食品种3大类。3类品种的大小、颜色、香味、光滑度（可能还有脆性、风味）等特点均有差别。不少品种含糖较高，中等酸度，丹宁含量很低。苹果除生食外，烹食方法也很多，常用作点心馅，苹果馅烤饼可能是最早的美国式甜食。炸苹果常与香肠、猪排等菜肴同食，尤其在欧洲特别普遍。最新的分类学证据显示苹果属的成员也不过38种，要查出一个“属谱”似乎也并非难事，但是每个种似乎都跟我们吃到的苹果有共同之处，并且每个种都可以提供一些水果，虽然有些味道着实不怎么样。从这个角度看，苹果属的每个种都有可能为超市中苹果的甘甜贡献了一分力量。大概在2000多年前，世界各地的果园都有种植。<br>苹果树多为异花授粉，有2%～4%的花座果较为理想。虽然成熟苹果的大小、形状、颜色和酸度因品种和环境条件的不同而差异很大，但通常圆形，直径50～100毫米，带红色或黄色。<br>中国是苹果生产大国，产量占苹果总产量的65%。主要品种：陕西洛川富士、陕西延川富士；甘肃天水花牛苹果、山东红星、山西万荣等。<br>美国的名种有Red Delicious（香港称地利蛇果，简称蛇果；台湾称五爪苹果）、Gold Delicious等。英国北威尔斯巴德西岛（Bardsey Island）则在近年发现新品种，比普通的果树更健康，除了虫害以外，并不会患病，被媒体称为世界上最罕有的苹果。<br>主要品种有：辽伏，寒富及其芽变系，早捷（Geneva Early）；夏绿；伏帅；安娜（Anna），藤牧1号；杰西麦克（Jerseymac）；珊新嘎拉（Royal Gala）及其芽变系；首红；新红星；超红；红玉；千秋；华冠；新世界，乔纳金及其芽变系；秦冠；王林、首红；灵宝苹果—华冠；栖霞苹果—红富士；花牛；北斗；金帅；大沙。</p>', '2020-05-11 10:04:20', 0, '水果'),
