(14, 'admin', '西瓜', '<p>西瓜（学名：Citrullus lanatus (Thunb.) Matsum. et Nakai）一年生蔓生藤本；茎、枝粗壮，具明显的棱。卷须较粗壮，具短柔毛，叶柄粗，密被柔毛；叶片纸质，轮廓三角状卵形，带白绿色，两面具短硬毛，叶片基部心形。雌雄同株。雌、雄花均单生于叶腋。雄花花梗长3-4厘米，密被黄褐色长柔毛；花萼筒宽钟形；花冠淡黄色；雄蕊近离生，花丝短，药室折曲。雌花：花萼和花冠与雄花同；子房卵形，柱头肾形。果实大型，近于球形或椭圆形，肉质，多汁，果皮光滑，色泽及纹饰各式。种子多数，卵形，黑色、红色，两面平滑，基部钝圆，通常边缘稍拱起，花果期夏季。<br>中国各地栽培，品种甚多，外果皮、果肉及种子形式多样，以新疆、甘肃兰州、山东德州、江苏东台等地最为有名。其原种可能来自非洲，广泛栽培于世界热带到温带，后传入中国。<br>西瓜为夏季之水果，果肉味甜，能降温去暑；种子含油，可作消遣食品；果皮药用，有清热、利尿、降血压之效。</p><h3>小天使西瓜</h3><p>小天使西瓜成熟果实为椭圆形，果型指数1.3左右;平均单瓜重1.5千克，最大可达3千克以上。果面光滑，底色鲜绿，上覆深绿色中细齿条;瓜瓤红色，瓤质脆嫩，汁多爽口，纤维少，中心折光糖含量13%左右，最高达13.5%以上;果皮厚0.5厘米左右，不裂果。商品瓜种子为褐色卵圆形，千粒重32克左右，平均单瓜种子数100粒左右。&nbsp;</p><h3>春雷西瓜</h3><p>春雷西瓜果实椭圆形，果形指数1.25。果皮薄且韧、厚仅0.6厘米，果面底色翠绿，均匀分布墨绿色细条纹带。条带间隙较宽且少杂斑。表面具光泽，美观。瓤艳红色。口味沙甜、爽润，不空心，不倒瓤，且纤维素较少，可溶性固形物含量13.9%以上，中、边搪度梯度小，可食率高，品质佳。</p><p><br></p><p><br></p>', '2020-05-19 17:05:47', 0, '水果'),
(15, 'admin', '梨', '<p><div style=\"text-align: left;\">梨，通常品种是一种落叶乔木或灌木，极少数品种为常绿，属于被子植物门双子叶植物纲蔷薇科苹果亚科。叶片多呈卵形，大小因品种不同而各异。花为白色，或略带黄色、粉红色，有五瓣。果实形状有圆形的，也有基部较细尾部较粗的，即俗称的“梨形”；不同品种的果皮颜色大相径庭，有黄色、绿色、黄中带绿、绿中带黄、黄褐色、绿褐色、红褐色、褐色，个别品种亦有紫红色；野生梨的果径较小，在1到4厘米之间，而人工培植的品种果径可达8厘米，长度可达18厘米。</div><div style=\"text-align: left;\">梨的果实通常用来食用，不仅味美汁多，甜中带酸，而且营养丰富，含有多种维生素和纤维素，不同种类的梨味道和质感都完全不同。梨既可生食，也可蒸煮后食用。在医疗功效上，梨可以通便秘，利消化，对心血管也有好处。在民间，梨还有一种疗效，把梨去核，放入冰糖，蒸煮过后食用还可以止咳；除了作为水果食用以外，梨还可以作观赏之用。</div></p><p style=\"text-align: left;\"><img src=\"https://bkimg.cdn.bcebos.com/pic/e7cd7b899e510fb34ca2d8e2d033c895d1430c0f?x-bce-process=image/resize,m_lfit,w_268,limit_1/format,f_jpg\">&nbsp;&nbsp;<br></p><p><h2>形态特征编辑</h2><h3><span style=\"font-weight: normal;\">根</span></h3>根系发达，垂直根深可达2-3m以上，水平根分布较广，约为冠幅2倍左右。喜光喜温，宜选择土层深厚、排水良好的缓坡山地种植，尤以砂质壤土山地为理想。干性强，层性较明显。结果早，结果期长，有些品种2-3年即开始结果，盛果期可维持50年以上。<br><h3>花</h3>梨花<br>梨花<br>梨树因分布范围广，因而物候期差别很大。就开花期而言，四川会理，梨树一般于2月上中旬开花，花呈白色吉林延边5月中旬开花；鸭梨在湖南长沙于3月上旬开花，辽宁北镇在5月上旬开花，各地花期相差近两个月。同一地区栽培的梨树，因种类、品种不同，物候期也有差异，从芽萌动到开花，秋子梨类品种最早，白梨类品种稍晚，砂梨类品种晚于白梨类，而以西洋梨品种为最晚，变动范围约为10天左右。</p><p><br></p>', '2020-05-19 17:15:47', 0, '水果'),
(16, 'admin', '香蕉', '<p>香蕉（学名：Musa nana Lour.）芭蕉科芭蕉属植物，又指其果实，热带地区广泛种植。香蕉味香、富含营养，植株为大型草本，从根状茎发出，由叶鞘下部形成高3～6米（10～20尺）的假杆；叶长圆形至椭圆形，有的长达3～3.5米（10～11.5尺），宽65厘米（26寸），10～20枚簇生茎顶。穗状花序下垂 [1]  ，由假杆顶端抽出，花多数，淡黄色；果序弯垂，结果10～20串，约50～150个。植株结果后枯死，由根状茎长出的吸根继续繁殖，每一根株可活多年。原产亚洲东南部，台湾、海南、广东、广西等均有栽培。</p><p><h3>形态特征编辑</h3>植株丛生，具匐匍茎，矮型的高3.5米以下，一般高不及2米，高型的高4～5米，假茎均浓绿而带黑斑，被白粉，尤以上部为多。<br>叶片长圆形，长2～2.2米，宽60～70厘米，先端钝圆，基部近圆形，两侧对称，叶面深绿色，无白粉，叶背浅绿色，被白粉；叶柄短粗，通常长在30厘米以下，叶翼显著，张开，边缘褐红色或鲜红色。穗状花序下垂，花序轴密被褐色绒毛，苞片外面紫红色，被白粉，内面深红色，但基部略淡，具光泽，雄花苞片不脱落，每苞片内有花2列。花乳白色或略带浅紫色，离生花被片近圆形，全缘，先端有锥状急尖，合生花被片的中间二侧生小裂片长，长约为中央裂片的1/2。<br>最大的果丛有果360个之多，重可达32千克，一般的果丛有果8～10段，约有果150～200个。果身弯曲，略为浅弓形，幼果向上，直立，成熟后逐渐趋于平伸，长12～30厘米，直径3.4～3.8厘米，果棱明显，有4～5棱，先端渐狭，非显著缩小，果柄短，果皮青绿色，在高温下催熟，果皮呈绿色带黄，在低温下催熟，果皮则由青变为黄色，并且生麻黑点（即“梅花点”），果肉松软，黄白色，味甜，无种子，香味特浓。<br>剑头芽（即慈姑芽或竹笋芽）假茎高约50厘米，基部粗壮，肉红色，上部细小，呈带灰绿的紫红色，黑斑大而显著，叶片狭长上举，叶背被有厚层的白粉。</p><p><br></p>', '2020-05-19 17:17:11', 0, '水果'),
(17, 'admin', '桃', '<p>桃（学名：Amygdalus persica L.）：蔷薇科、桃属植物。落叶小乔木；叶为窄椭圆形至披针形，长15厘米，宽4厘米，先端成长而细的尖端，边缘有细齿，暗绿色有光泽，叶基具有蜜腺；树皮暗灰色，随年龄增长出现裂缝；花单生，从淡至深粉红或红色，有时为白色，有短柄，直径4厘米，早春开花；近球形核果，表面有毛茸，肉质可食，为橙黄色泛红色，直径7.5厘米，有带深麻点和沟纹的核，内含白色种子。<br>是一种果实作为水果的落叶小乔木，花可以观赏，果实多汁，可以生食或制桃脯、罐头等，核仁也可以食用。果肉有白色和黄色的，桃有多种品种，一般果皮有毛，“油桃”的果皮光滑；“蟠桃”果实是扁盘状；“碧桃”是观赏花用桃树，有多种形式的花瓣。<br>原产中国，各省区广泛栽培。世界各地均有栽植。</p><p><h3>形态特征编辑</h3>桃是一种乔木，高3-8米；树冠宽广而平展；树皮暗红褐色，老时粗糙呈鳞片状；小枝细长，无毛，有光泽，绿色，向阳处转变成红色，具大量小皮孔；冬芽圆锥形，顶端钝，外被短柔毛，常2-3个簇生，中间为叶芽，两侧为花芽。 [2] <br>叶片长圆披针形、椭圆披针形或倒卵状披针形，长7-15厘米，宽2-3.5厘米，先端渐尖，基部宽楔形，上面无毛，下面在脉腋间具少数短柔毛或无毛，叶边具细锯齿或粗锯齿，齿端具腺体或无腺体；叶柄粗壮，长1-2厘米，常具1至数枚腺体，有时无腺体。<br>花单生，先于叶开放，直径2.5-3.5厘米；花梗极短或几无梗；萼筒钟形，被短柔毛，稀几无毛，绿色而具红色斑点；萼片卵形至长圆形，顶端圆钝，外被短柔毛；花瓣长圆状椭圆形至宽倒卵形，粉红色，罕为白色；雄蕊约20-30，花药绯红色；花柱几与雄蕊等长或稍短；子房被短柔毛。 <br>果实形状和大小均有变异，卵形、宽椭圆形或扁圆形，直径（3）5-7（12）厘米，长几与宽相等，色泽变化由淡绿白色至橙黄色，常在向阳面具红晕，外面密被短柔毛，稀无毛，腹缝明显，果梗短而深入果洼；果肉白色、浅绿白色、黄色、橙黄色或红色，多汁有香味，甜或酸甜；核大，离核或粘核，椭圆形或近圆形，两侧扁平，顶端渐尖，表面具纵、横沟纹和孔穴；种仁味苦，稀味甜。花期3-4月，果实成熟期因品种而异，通常为8-9月。&nbsp;</p>', '2020-05-19 17:18:27', 0, '水果'),
(18, 'admin', '哈密瓜', '<p>哈密瓜，新疆维吾尔自治区哈密地区特产，中国国家地理标志产品。 <br>哈密瓜主产于吐哈盆地（即吐鲁番盆地），它形态各异，风味独特，瓜肉肥厚，清脆爽口。哈密瓜营养丰富，含糖量最高达21%。哈密的甜瓜在东汉永平年间就成为进贡的异瓜种了。至清代，被哈密王作为贡品，受康熙赏赐而得名哈密瓜。时哈密瓜“往年进贡”、“瓜莫盛于哈密”、“瓜则充贡品者真出哈密”。追根溯源，哈密瓜却源于吐鲁番鄯善县一带。<br>哈密瓜的品种资源很丰富。按成熟期不同，分早熟、中熟和晚熟品种。早、中熟的称为夏瓜，晚熟的称为冬瓜。早熟的品种主要有黄旦子、纳西甘、一包糖、包孜可口奇、石甜401等，其特点是皮薄肉细，香味浓郁。中熟品种主要有红心脆多汁、肉厚细腻、清香爽口而博得人们喜爱。晚熟品种主要有黑眉毛密极干、青麻皮密极干、炮台红、青皮红肉、青皮冬瓜、黄皮白肉可口奇等。“黑眉毛”、“青麻皮”的特点是瓜肉呈淡青色，储藏后肉质由脆硬，逐渐变得绵软多汁、甜爽而又醇香。<br>2009年03月30日，原国家质检总局批准对“哈密瓜”实施地理标志产品保护。</p><div label-module=\"para-title\"><h3>品质特性</h3></div><div label-module=\"para\">哈密瓜为一年生匍匐或攀援草本；茎、枝有棱，有黄褐色或白色的糙硬毛和疣状突起。卷须纤细，单一，被微柔毛。叶柄长8—12厘米，具槽沟及短刚毛；叶片厚纸质，近圆形或肾形，长、宽均8—15厘米，上面粗糙，被白色糙硬毛，背面沿脉密被糙硬毛，边缘不分裂或3—7浅裂，裂片先端圆钝，有锯齿，基部截形或具半圆形的弯缺，具掌状脉。<div><a nslog-type=\"9317\" href=\"https://baike.baidu.com/pic/%E5%93%88%E5%AF%86%E7%93%9C/431545/0/500fd9f9d72a60591e1ec6742b34349b033bba55?fr=lemma&amp;ct=single\" target=\"_blank\" title=\"\"><img src=\"https://bkimg.cdn.bcebos.com/pic/500fd9f9d72a60591e1ec6742b34349b033bba55?x-bce-process=image/resize,m_lfit,w_220,h_220,limit_1\" alt=\"\"></a></div></div><div label-module=\"para\">花单性，雌雄同株。雄花：数朵簇生于叶腋；花梗纤细，长0.5—2厘米，被柔毛；花萼筒狭钟形，密被白色长柔毛，长6—8毫米，裂片近钻形，直立或开展，比筒部短；花冠黄色，长2厘米，裂片卵状长圆形，急尖；雄蕊3毫米，花丝极短，药室折曲，药隔顶端引长；退化雌蕊长约1毫米。雌花：单生，花梗粗糙，被柔毛；子房长椭圆形，密被长柔毛和长糙硬毛，花柱长1—2毫米，柱头靠合，长约2毫米。</div><div label-module=\"para\">果实的形状、颜色因品种而异，通常为球形或长椭圆形，果皮平滑，有纵沟纹，或斑纹，无刺状突起，果肉白色、黄色或绿色，有香甜味；种子污白色或黄白色，卵形或长圆形，先端尖，基部钝，表面光滑，无边缘。花果期夏季。</div><p><br></p>', '2020-05-19 17:19:52', 0, '水果');
